            this.label10.Name = "label10";
            this.label10.Padding = new System.Windows.Forms.Padding(4);
            this.label10.Size = new System.Drawing.Size(700, 70);
            this.label10.TabIndex = 8;
            this.label10.Text = "查看、管理一级、二级指标以及详细的考评标准。\r\n通过窗口上的按钮完成数据添加、修改、保存等操作。\r\n由于考评数据的历史连贯性要求，不建议删除指标和评分标准。\r\n指" +
                "标维护完成后，将在新的考评执行时应用。往年数据不受影响。";
