            this.label9.TabIndex = 7;
            this.label9.Text = "导出医院提报数据模版，导入医院提报的数据，包括基础数据、药品目录以及耗材目录。\r\n数据模版采用 Microsoft Office Excel 文件格式，文件名格式" +
                "<医院名称>_<年度>.xls。各医院可根据模板要求录入基础数据、药品目录以及耗材目录。\r\n数据填写完毕后，执行“导入”操作将数据写入数据库，这些数据将在客观评" +
                "价及主观评价中使用。";
